import logo from './logo.svg';
import './App.css';

function App() {
  const wrapper = document.getElementById('difficulty_selector')

  function addButton(text) {
    const button = document.createElement('button');
    button.type = 'button';
    button.innerText = text;
    button.classList.add('button-34');
    wrapper.appendChild(button);
  }

  addButton('Easy');
  addButton('Normal');
  addButton('Hard');

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
          <p>Let's play a small game, choose a difficulty</p>
        </div>
        <div id='difficulty_selector'>
        </div>
      </header>
    </div>
  );
}

export default App;
